I cannot believe I’m posting about my birthday with my August wrap up, but schedules and life and what can you do. I turned twenty! And I took myself on a long walk to tire my brain out so I don’t fall into a hole of existential crisis because I’m TWENTY. Twenty years old, an official adult, still cannot answer friends’ messages in a timely manner. See, existential crisis! More I crisis the less I read, see the three books I read this month. 
-
Pride and Prejudice (4🌟) - Jane Austen giving better relationship goals/advice than 90% of the romance movies on Netflix, 200 years ago.
.
Magnus Chase and the Hammer of Thor by Rick Riordan (4🌟) - LOKI! WE TRUSTED YOU! YOU WERE SUPPOSED TO BE THE GOOD DAD! MOM! PARENT! ARGhAHHHHHH!
.
The Library Book by Susan Orleans (4.5🌟) - Man the USSR and USA competed everywhere during the Cold War. Space race. Olympics. Nuclear arms race. Who can make the biggest news story on April 30th, 1986. The Soviets won with the Chernobyl meltdown over the biggest library fire in American history. Yay?
